import ReactDOM from 'react-dom'
import React from 'react'

function Tick() {
    return (
        <div>
            <h1>Hello, world!</h1>
            <h2>It's {new Date().toLocaleTimeString()}.</h2>
        </div>
    );
}

ReactDOM.render(
    setInterval(<Tick />, 10400),
    document.getElementById('root')
)
